import styled from "styled-components";
import { A } from "../../styled";

export const StyledA = styled(A)`
  width: 40px;
  height: 40px;
  margin: 0;
  padding: 0;
  border: 1px solid #00C6BD;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
`;
